import React from 'react';




const MealList = (props) => {
    console.log(props.passMealDetails);


    const RenderMealList = props.passMealDetails.map((each) => {

        return(
            <div>

            <div key={each.id} style={{display:"flex",justifyContent:"space-between",alignItems:"center",padding:"25px"}}>
                 <p className='lead'><b>{each.name} </b></p>
                </div>

            </div>    
        );
    })

    return(
      <div style={{backgroundColor:"lightblue", borderRadius:"25px",marginTop:"3%"}}>
           <div align='center' >
                     <h1  className='display-5'>Meal List</h1></div>
          {RenderMealList}


      </div>
  );
};

export default MealList;
